import { Box } from "@mui/material";
import React, { Component } from "react";

class Buttons extends Component {
  render() {
    return (
      <Box
        sx={{
          //   position: "absolute",
          //   width: "261.7px",
          //   height: "79.85px",
          //   left: "589px",
          //   top: "437.08px",
          position: "absolute",
          left: "1.65%",
          right: "-0.24%",
          top: "0%",
          bottom: "22.35%",

          border: "1px solid #000",
          boxSizing: "border-box",
          transform: "rotate(4deg)",
        }}
      >
        button
      </Box>
    );
  }
}

export default Buttons;
